<p>
<p>У Харкові завершується молодіжний чемпіонат України з самбо. Для участі у цих змаганнях управління фізичної культури та спорту Львівської ОДА відрядило 25 спортсменів. Відтак, нашим самбістам вдалось вибороти шість медалей у категоріях юнаки, до якої належать спортсмени років та юніори — самбісти 19 та 20 років. Микола виступає у ваговій категорії понад 98 кг, тренує його Ярослав Грибик. Марта Чаплінська, яка виступає у ваговій категорії 50 кг, стала віцечемпіонкою України серед юніорок.</p>
<p>Її тренують Андрій Мельник та Роман Юнак. Серед юніорів срібло також вибороли Віталій Стець, який виступав у ваговій категорії до 71 кг, Артур Смук у ваговій категорії 75 кг. Бронзовим призером серед юніорів став Роман Шийка, який виступав у категорії до 64 кг. Зауважимо, на килимі харківського Палацу спорту за два дні змагань розіграли 18 комплектів нагород. Загалом на них змагались майже шість сотень спортсменів із 22 регіонів України.</p>
<p>Золото змагань в бігу на дистанцію м серед жінок здобула Орися Дем'янюк-Мочульська. Атлетка Львівської школи вищої спортивної здолала дистанцію за 2. На цій же дистанції встановила особистий рекорд та виконала норматив кандидатки у майстри спорту випускниця Буської ДЮСШ Уляна Рачинська, зупинившись за крок до медалі. Серед чоловіків у бігу на м з перешкодами переможцем став ще один легкоатлет Львівської школи вищої спортивної майстерності Роман Ростикус, який здолав дистанцію за  Четвертим фінішував представник Львівщини Станіслав Козак, оновивши своє особисте досягнення. Срібним призером став Ігор Желем, який фінішував на 3 секунди пізніше.</p>
<p>Срібним призером у бігу на м серед чоловіків став Олег Семенюк із результатом  У стрибках у висоту бронзу виборола Ілона Заскалько з результатом 1.</p><a id='i1'></a><h3>Подати безплатне оголошення в Новояворівську: приватна газета</h3><p>Високі результати у цій дисципліні також продемонстрували Сергій Слісенко та Ілля Оліферовський. Сьогодні, 4 лютого,  на Турківщині завершився Чемпіонат України з лижних гонок. У часть у змаганнях взяли спортсмени з дев'яти областей України. Привітав учасників голова Львівської обласної державної адміністрації Максим Козицький. Для нас усіх Вони - справжні Герої, адже не лише захищають честь держави на змаганнях, але й є прикладом, який надихає тисячі людей. Вірю, що учасники чемпіонату з лижних перегонів  ще неодноразово завітають на Львівщину", - зазначив очільник Львівщини.</p>
<p>Зазначимо, що змагання відбувались на базі Західного реабілітаційно-спортивного центру. Він є однією з найсучасніших спортивних баз України та Європи. Лижні траси загальною довжиною 5,5 км пройшли сертифікацію Міжнародної федерації лижного спорту FIS та адаптовані для використання не тільки спортсменами-лижниками, а й спортсменами - паралімпійцями з вадами зору та ураженнями опорно-рухового апарату.</p>
		
	<p>Стадіон для лижних гонок з боксами призначений для проведення індивідуальних стартів, стартів гонок переслідування, мас-стартів та естафетних стартів. Переконаний, що пройде не так багато часу і наш регіон стане східноєвропейською Меккою зимових видів спорту", - додав Максим Козицький. Програма Creative Spark, участь у якій візьмуть студенти та молоді науковці закладів фахової передвищої та вищої освіти, покликана розвивати підприємницькі навички та креативність у створенні бізнес-проектів.</p>
<p>Програма складається з трьох навчальних блоків серед яких пошук ідеї, створення бізнес-моделі та презентація для інвесторів. Все що працює на розвиток  - вартує підтримки, адже без розвитку людство не прогресуватиме», - зазначив директор департаменту освіти та науки Львівської ОДА Олег Паска. Участь у програмі для учасників дасть можливість майбутньої співпраці з Tech StartUp School, cертифікат, використання можливостей Tech LabInno, нетворкінг та нові знайомства, можливість розвитку та участі у різних стартап-конкурсах. В Україні Британська рада працює у кількох напрямах, серед яких освіта, мистецтво, культура, суспільство та англійська мова.</p>
<p>Саме в напрямку освіти Британська рада займається підтримкою впровадження реформ. В освітній сфері Британія має великий досвід, яким хоче поділитись з Україною. Ми також щороку проводимо конкурс ідей та проектів. У переможців є можливість отримати менторську підтримку від британських експертів та грошовий грант», - розповіла координатор освітніх проектів Британської ради Юлія Соболь.</p><strong><a id='i2'></a><h2>Новини Яворівщини: записи сообщества | ВКонтакте</h2></strong><p>Переможцям спеціального конкурсу у рамках проекту буде надана стипендія на розвиток стартап-проектів. Програма передбачає участь у різних конкурсах. Один із них охоплює сім країн-партнерів. Така співпраця дає додаткові шанси себе розвивати.</p><a id='i3'></a><h3>Графік роботи:</h3><p>Ця програма є можливістю показати себе та свої ідеї на міжнародному рівні та отримати найкращих менторів і спільно з ними розробити свій продукт, який буде конкурентоздатним на світовому ринку. Доклавши зусиль, кожен зможе здобути позитивні результати», - акцентував засновник та керівник Tech StartUp School, доктор економічних наук Назарій Подольчак. Взяти участь у проекті можуть не лише переможці обласної премії ОДА: долучитись до навчання зможуть усі, хто виявить бажання. Наші тренери долучають учасників до подій у сфері креативного підприємництва. Третій рік поспіль ми обираємо 20 фіналістів, тож кожен може взяти участь і перемогти.</p>
<p>Львівщина зараз практично - центр розвитку креативних ідей. Тут є багато можливостей для розвитку», - зазначив  координатор проекту, доктор Кінгстонського університету Алан Фловер. Зазначимо, торік переможець категорії креативних проектів — став проект  Eleobike, розумна система безпеки, яка перетворює звичайні велосипеди в електричні. Команда була номінована на участь у конкурсі Національним університетом «Львівська політехніка». Окрім того, переможець категорії цифрових технологій —  став проект Warm paper, мережа автоматизованих точок друку.</p>
<p>Проект розроблено командою Національного університету «Львівська політехніка. Ще один проект-переможець виборов визнання у категорії соціальних проектів — Lady Di Atelier , перше українське інклюзивне ательє, що забезпечує рівні умови праці для людей з інвалідністю. Мета проекту — забезпечити працевлаштування для людей з інвалідністю та дати їм почуття рівності. Для участі у навчанні треба заповнити онлайн-форму. Традиційне щомісячне голосування членів колегії управління фізичної культури та спорту Львівської облдержадміністрації та членів виконкому відділення НОК України у Львівській області визначило найкращого спортсмена Львівщини за підсумками січня року.</p>
		
			
