	<p>Нею стала річна Юлія Ткач. Також наприкінці місяця Юлія стала бронзовою призеркою чемпіонату України у ваговій категорії 62 кг. Нагадаємо, у вона стала чемпіонкою світу, а титул чемпіонки Європи здобувала вже тричі: у му, му та роках. Також представниця Львівщини перемогла на Європейських Ігорах у році.</p>
		
