	<p>Наприкінці минулого тижня на схилах гірськолижного комплексу «Буковиця» поблизу Борислава відбувся український етап триетапних міжнародних дитячих змагань з гірськолижного спорту Karpatia OPEN. Золото змагань вдалось вибороти вихованцю Славської комплесної дитячо-юнацької спортивної школи Дмитру Гашпару.</p><strong><a id='i4'></a><h2>Квитки на концерти у клубах 2021 в Україні</h2></strong><p>Спортсмен виступав у категорії U Серед молодших юнаків переможцем став річний Олексій Уфімцев зі спортивного клубу «Евеленч». Фото - ГК "Буковиця". У Чернігові сьогодні, 2 лютого, завершальний день Чемпіонату України з настільного тенісу серед дорослих. Спортсмени борються за перемогу в особистій першості. Серед жінок титул чемпіонки виборола річна представниця Львівщини, майстер спорту України Соломія Братейко. Соломія третій рік поспіль виборює титул чемпіонки України з настільного тенісу. Це вже друге золото Соломії на цьогорічному чемпіонаті.</p>
<p>У неділю вона з киянкою Веронікою Гуд перемогла у парних змаганнях. Ви маєте надійних партнерів, щоб тут реалізовувати свої інвестиційні, гуманітарні, культурні проекти. Я впевнений, що враження та напрацювання сьогоднішнього дня ви пронесете упродовж цього року. Минулого року ми були очевидцями підписання договору між компанією «Еко-Оптіма» і ЄБРР і сьогодні цей інвестиційний проект було зреалізовано  - 36 МВт, понад 40 млн доларів інвестицій.</p>
<p>І це лише один приклад цьогорічного результату. Знаю, що цей рік буде важким, але тільки в праці кується справжній успіх кожного бізнесу і кожної країни. Я би дуже хотів, щоб майданчик економічного форуму був майданчиком для комунікації та налагодження співпраці для кожного з нас»,-  зазначив перший заступник голови Львівської ОДА Ростислав Замлинський. Перший день форуму зібрав на Арені-Львів понад учасників із України та закордону. У Львівській опері привітали переможців «Ігор Нескорених». Сьогодні, 1 листопада, під час урочистої академії у Львівському національному академічному театрі опери та балету імені Соломії Крушельницької зал оплесками привітав чемпіонів Invictus Games, що відбувалися у жовтні в австралійському Сіднеї.</p>
<p>Новітнім героям українсько-російської війни Богданові Оксентюку та Сергієві Шимчаку, а також їх тренеру зі стрільби з лука Олені Паламарчук аплодували стоячи. Впродовж жовтня, австралійському Сіднеї тривали міжнародні змагання серед військовослужбовців та ветеранів, які зазнали травм, поранень або захворювань під час бойових дій Invictus Games Ігри Нескорених. Українці привезли із Сіднею 7 золотих та 10 срібних медалей. Богдан Оксентюк ветеран Національної гвардії України, учасник АТО з по рік став володарем золотої медалі з легкої атлетики біг на м , срібної та бронзової медалей з плавання 50 та метрів вільним стилем.</p>
<p>Сьогодні, 1 листопада Львівщина урочисто відзначає річчя створення Західноукраїнської Народної Республіки. До учасників та гостей мистецького проекту звернувся Перший віце-прем'єр-міністр України Степан Кубів. І виборювала своє право з багатьма ідейними ворогами півночі сходу та заходу. Період української революції українське питання було в епіцентрі міжнародної політики. Сильна домекоратична деражана ніколи не входила до планів світової спільноти.</p>
<p>Найбільшим українським здобутком було проголошення соборності», - зазначив під час урочистої академії Перший віце-міністр України Степан Кубів.</p>
		
