			</ol>
		
	<p>Українська держава завжди відзначає тих, хто найбільше докладається до творення державності, до самоствердження українців у цілому світі», - наголосив голова Львівської ОДА Олег Синютка. До проекту запросили відомих українських виконавців, у межах мистецького вечора звучатимуть пісні Січових стрільців та сучасні українські.</p>
<p>Це насичене мультимедійне дійство, яке про важливість відновлення української державності. Окрім того,  за значний особистий внесок в утвердження української державності, історичної правди та нагоди річчя Західноукраїнської Народної Республіки, орденом князя Ярослава Мудрого IV ступеня Любомира Медведя — завідувача кафедри монументального живопису, професора Львівської національної академії мистецтв, академіка, хрестом Івана Мазепи — Тараса Куликовця — станичного Дрогобицької міської Станиці Всеукраїнського Братства ОУН-УПА ім.. Серед виконавців, які долучились до дійства — Олег Скрипка, Софія Федина, інструментальний гурт "Rockkoko" тощо.</p>
<p>В межах Міжнародного економічного форуму дискутували про високотехнологічні інвестиції. Завершальною панельною дискусією першого дня Міжнародного економічного форуму стали високотехнологічні інвестиції. Дійсно тут дуже висока концентрація високоінтелектуальних фахівців і як ми бачимо це не тільки ІТ, але і до прикладу харчова промисловість.</p><img src="https://f1.love.ua/d_Bw_30jdi_blXoRjL63EPDbO.jpg" alt="Account Options" style="max-width: 480px; max-height: 480px;"/><p>Дуже важливою також є і підтримка місцевої влади. Це також присутність певного інтелектуально-освітнього хабу на Західній Україні. Якщо дивитися в майбутнє, то ми дуже відкриті до діалогу з компаніями із Львівщини.</p>
</p>
